    false,nt"url": null,nt"notes": "Water levels and water quality parameters
    recorded on Pool 2B. Water-Data Report 2012 413721083124001 Pool 2B at Ottawa NWR
    LOCATION: Lat. 41u00b037'21.08"N, long 83u00b012'38.44"W, near Oak Harbor, OH.
    Ottawa County, OH on Ottawa National Wildlife Refuge. MAXIMUM SURFACE AREA: 97 acres
    PERIOD OF RECORD: Datalogger installed 2009. Regional Office data analysis starts
    2009. GAGE SITE Pre August 2012: Design Analysis 522+ in communication with Esterline
    pressure transducer and YSI water quality probe in a square metal gage house. GOES
    antenna in communication with DA 522+ DCP transmits every hour in a 10 second window
    at abaud rate of 300. Instruments are powered by a 1.2 ampere solar panel run to
    a deep cycle marine battery through a Sunsaver power regulator. Solar panel, GPS
    and GOES antennas are attached to a mast connected to the gage house. Stage is collected
    at 15- minute intervals and water quality is collected at 30-minute intervals. Weekly
    gage height data available online, NWS Id is OAK01.GAGE SITE August 2012: Gage enclosure
    relocated from west side of pool to north side of the pool on August 23, 2012. The
    YSI water quality probe and pressure transducer were relocated approx. 30 ft. NE
    of previous location. Installed AccQcomm interface module which communicates to
    existing logger and to Teledyne RD Instruments vertical acoustic Doppler (V-ADCP),
    which measures velocity and discharge through the water control structure. The AccQcomm
    interface module and V-ADCP instruments are powered by an additional 1.2 ampere
    solar panel run to a deep cycle marine battery through a Sunsaver power regulator.
    COOPERATION: USGS Great Lakes Science Center and Ottawa NWR",nt"license_title":
